import React from 'react'
import { View, Text, SafeAreaView, TouchableOpacity } from 'react-native'

export default function HomeScreen({ navigation }) {
    return (
        <SafeAreaView>
            <Text>Home</Text>
            <TouchableOpacity onPress={() => navigation.navigate('Order')}>
                <Text>move</Text>
            </TouchableOpacity>
        </SafeAreaView>
    )
}
